  false,\n\t\"url\": null,\n\t\"notes\": \"The Muscatatuck NWR Safety Plan discusses
  policies for the safety of the station employees, volunteers, and public. This plan
  seeks to identify and correct unsafe conditions and preclude unsafe acts through
